    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}User index{% endblock %}

{% block body %}
    <h1>User index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>Login</th>
                <th>Picture</th>
                <th>LastName</th>
                <th>FirstName</th>
                <th>Training</th>
                <th>BirthDate</th>
                <th>Phone</th>
                <th>ActualJob</th>
                <th>Links</th>
                <th>LastConnection</th>
                <th>RegistrationDate</th>
                <th>ArchivingDate</th>
                <th>Desactivation</th>
                <th>NotificationCount</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.password }}</td>
                <td>{{ user.login }}</td>
                <td>{{ user.picture }}</td>
                <td>{{ user.lastName }}</td>
                <td>{{ user.firstName }}</td>
                <td>{{ user.training }}</td>
                <td>{{ user.birthDate ? user.birthDate|date('Y-m-d') : '' }}</td>
                <td>{{ user.phone }}</td>
                <td>{{ user.actualJob }}</td>
                <td>{{ user.links }}</td>
                <td>{{ user.lastConnection ? user.lastConnection|date('Y-m-d') : '' }}</td>
                <td>{{ user.registrationDate ? user.registrationDate|date('Y-m-d') : '' }}</td>
                <td>{{ user.archivingDate ? user.archivingDate|date('Y-m-d') : '' }}</td>
                <td>{{ user.desactivation ? 'Yes' : 'No' }}</td>
                <td>{{ user.notificationCount }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'id': user.id}) }}\">show</a>
                    <a href=\"{{ path('user_edit', {'id': user.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"19\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('user_new') }}\">Create new</a>
{% endblock %}
", "user/index.html.twig", "C:\\Users\\pouil\\Desktop\\Stackistes\\MLS\\mls_back-end\\templates\\user\\index.html.twig");
